    async createFolder() {
        return new Promise((resolve, reject) => {
            fs.access(`./import`, (error) => {
                if (!error) {
                    return null;
                }
                else {
                    fs.mkdir(`./import`, { recursive: true }, (err) => {
                        if (err)
                            reject(err);
                        resolve();
                    });
                }
            });
        });
    }
